INSERT INTO "proc" VALUES ('mysql','lambda_async','PROCEDURE','lambda','SQL','READS_SQL_DATA','YES','DEFINER',_binary 'IN functionName VARCHAR(1600), IN inputPayload mediumtext','',_binary 'BEGIN\n   AWSLAMBDA(functionName,inputPayload,\'0\');\nEND','rdsadmin@localhost','2013-10-23 20:13:10','2013-10-23 20:13:10','NO_ENGINE_SUBSTITUTION','','utf8','utf8_general_ci','utf8_general_ci',_binary 'BEGIN\n   AWSLAMBDA(functionName,inputPayload,\'0\');\nEND'),('mysql','rds_collect_global_status_history','PROCEDURE','rds_collect_global_status_history','SQL','CONTAINS_SQL','NO','DEFINER','','',_binary 'begin\n\n  declare my_row_count int(5) default 0;\n  DECLARE sql_logging BOOLEAN;\n  select @@sql_log_bin into sql_logging;\n  set @@sql_log_bin=off;\n  set transaction isolation level read committed;\n  insert into rds_global_status_history ( collection_start, variable_name, variable_value, variable_delta )\n  select b.collection_end, a.variable_name, a.variable_value, a.variable_value-coalesce(b.variable_value,0) as variable_delta \n  from information_schema.global_status a \n  left outer join rds_global_status_history b on a.variable_name = b.variable_name \n  where b.collection_end = (select max(collection_end) from rds_global_status_history);\n  \n  select row_count() into my_row_count;\n  \n  if my_row_count = 0\n  then\n      insert into rds_global_status_history ( collection_start, variable_name, variable_value, variable_delta )\n      select null, variable_name, variable_value, variable_value from information_schema.global_status ;\n  end if;\n  commit;\n  set @@sql_log_bin=sql_logging;\nend','rdsadmin@localhost','2017-07-13 01:27:22','2017-07-13 01:27:22','NO_ENGINE_SUBSTITUTION','','latin1','latin1_swedish_ci','latin1_swedish_ci',_binary 'begin\n\n  declare my_row_count int(5) default 0;\n  DECLARE sql_logging BOOLEAN;\n  select @@sql_log_bin into sql_logging;\n  set @@sql_log_bin=off;\n  set transaction isolation level read committed;\n  insert into rds_global_status_history ( collection_start, variable_name, variable_value, variable_delta )\n  select b.collection_end, a.variable_name, a.variable_value, a.variable_value-coalesce(b.variable_value,0) as variable_delta \n  from information_schema.global_status a \n  left outer join rds_global_status_history b on a.variable_name = b.variable_name \n  where b.collection_end = (select max(collection_end) from rds_global_status_history);\n  \n  select row_count() into my_row_count;\n  \n  if my_row_count = 0\n  then\n      insert into rds_global_status_history ( collection_start, variable_name, variable_value, variable_delta )\n      select null, variable_name, variable_value, variable_value from information_schema.global_status ;\n  end if;\n  commit;\n  set @@sql_log_bin=sql_logging;\nend'),('mysql','rds_disable_gsh_collector','PROCEDURE','rds_disable_gsh_collector','SQL','CONTAINS_SQL','NO','DEFINER','','',_binary 'begin\n  DECLARE sql_logging BOOLEAN;\n  select @@sql_log_bin into sql_logging;\n  set @@sql_log_bin=off;\n  alter event ev_rds_gsh_collector DISABLE;\n  select \'Collector Disabled\' as `Success`;\n  set @@sql_log_bin=sql_logging;\n end','rdsadmin@localhost','2017-07-13 01:27:22','2017-07-13 01:27:22','NO_ENGINE_SUBSTITUTION','','latin1','latin1_swedish_ci','latin1_swedish_ci',_binary 'begin\n  DECLARE sql_logging BOOLEAN;\n  select @@sql_log_bin into sql_logging;\n  set @@sql_log_bin=off;\n  alter event ev_rds_gsh_collector DISABLE;\n  select \'Collector Disabled\' as `Success`;\n  set @@sql_log_bin=sql_logging;\n end'),('mysql','rds_disable_gsh_rotation','PROCEDURE','rds_disable_gsh_rotation','SQL','CONTAINS_SQL','NO','DEFINER','','',_binary 'begin\n  DECLARE sql_logging BOOLEAN;\n  select @@sql_log_bin into sql_logging;\n  set @@sql_log_bin=off;\n  alter event ev_rds_gsh_table_rotation DISABLE;\n  select \'Table Rotation Disabled\' as `Success`;\n  set @@sql_log_bin=sql_logging;\n end','rdsadmin@localhost','2017-07-13 01:27:22','2017-07-13 01:27:22','NO_ENGINE_SUBST