CREATE DEFINER=`rdsadmin`@`localhost` PROCEDURE `rds_rotate_general_log`()
    READS SQL DATA
    DETERMINISTIC
begin
 declare is_set_sql_bin_log boolean default 0; 
 declare org_sql_bin_log boolean default 0; 
 declare is_locked boolean default 0; 
 declare lock_rec_value integer; 
 declare repair_table_type integer default 0; 
 declare errno INT; 
 declare msg TEXT; 
 
 declare continue handler for 1194 
 begin 
 if repair_table_type = 1 then repair no_write_to_binlog table mysql.general_log; 
 end if; 
 
 if repair_table_type = 2 then 
 repair no_write_to_binlog table mysql.general_log_backup; 
 end if; 
 
 if repair_table_type = 3 then 
 repair no_write_to_binlog table mysql.general_log2; 
 end if; 
 
 end; 
 
 declare exit handler for sqlexception 
 begin 
 GET CURRENT DIAGNOSTICS CONDITION 1 
 errno = MYSQL_ERRNO, msg = MESSAGE_TEXT; 
 
 SELECT errno, msg; 
 
 if is_set_sql_bin_log = 1 then 
 set session sql_log_bin = org_sql_bin_log; 
 set is_set_sql_bin_log = 0; 
 end if; 
 
 if is_locked = 1 then 
 select release_lock('rds_rotate_general_log_lock_927562058') into lock_rec_value; 
 set is_locked = 0; 
 end if; 
 
 end; 
 
 select get_lock('rds_rotate_general_log_lock_927562058', 0) into lock_rec_value; 
 set is_locked = 1; 
 
 if lock_rec_value = 1 then 
 if exists(select table_name from information_schema.tables where table_name = 'general_log' and table_schema = 'mysql') then 
 set repair_table_type = 1; 
 set @output = (select 1 from general_log limit 1); 
 end if; 
 
 if exists(select table_name from information_schema.tables where table_name = 'general_log_backup' and table_schema = 'mysql') then 
 set repair_table_type = 2; 
 set @output = (select 1 from general_log_backup limit 1); 
 end if; 
 
 if exists(select table_name from information_schema.tables where table_name = 'general_log2' and table_schema = 'mysql') then 
 set repair_table_type = 3; 
 set @output = (select 1 from general_log2 limit 1); 
 end if; 
 select @@SESSION.sql_log_bin into org_sql_bin_log; 
 set session sql_log_bin=off; 
 set is_set_sql_bin_log = 1; 
 
 if exists(select table_name from information_schema.tables where table_name = 'general_log2' and table_schema = 'mysql') then 
 if not exists(select table_name from information_schema.tables where table_name = 'general_log' and table_schema = 'mysql') then 
 rename table mysql.general_log_backup to mysql.general_log, mysql.general_log2 to mysql.general_log_backup; 
 elseif not exists(select table_name from information_schema.tables where table_name = 'general_log_backup' and table_schema = 'mysql') then 
 rename table mysql.general_log2 to mysql.general_log_backup; 
 else 
 drop table if exists general_log2; 
 end if; 
 end if; 
 
 truncate table mysql.general_log_backup; 
 rename table mysql.general_log_backup to mysql.general_log2, mysql.general_log to mysql.general_log_backup, mysql.general_log2 to mysql.general_log;
 
 set session sql_log_bin = org_sql_bin_log; 
 set is_set_sql_bin_log = 0; 
 
 select release_lock('rds_rotate_general_log_lock_927562058') into lock_rec_value; 
 set is_locked = 0; 
 else 
 select 'the other operation of rotating the general log is in process' as message_text; 
 end if;  
 end ;;
DELIMITER ;
